import React from 'react';
import { MDBBtn, MDBContainer,MDBNavbar,MDBNavbarBrand  } from 'mdb-react-ui-kit';
import { useState } from 'react';
import './nav.css';


export default function Navi(){
    const [navBar,SetNavBar] = useState();

    const changeBackground = () => {
        if (window.scrollY >= 90){
            SetNavBar(true);
        }
        else{
            SetNavBar(false);
        }
    };

    window.addEventListener('scroll',changeBackground);    
    return(
    <div >
    <MDBNavbar className={navBar ? 'NavBar active' : NavBar} >
            <MDBContainer>
                    <MDBNavbarBrand>React</MDBNavbarBrand>
                    <MDBNavbarBrand>MDBootstrap</MDBNavbarBrand>
                    <MDBNavbarBrand>Navbar</MDBNavbarBrand>
                    <MDBNavbarBrand>GeeksforGeeks</MDBNavbarBrand>
            </MDBContainer>
    </MDBNavbar>
    </div>
    );
}
